# Migrating to Discord Player v5

We have introduced some breaking changes in Discord Player v5. Which means, your old code will no longer work with v5.
The new update brings new features as well as better management of different things. This also uses the new **[@discordjs/voice](https://github.com/discordjs/voice)** library!

## Basic Example

```diff
- player.play(message, query);
+ const queue = player.createQueue(message.guild);
+ const song = await player.search(query, {
+   requestedBy: message.author
});
+ 
+ try {
+   await queue.connect(message.member.voice.channel);
+ } catch {
+   message.reply("Could not join your voice channel");
+ }
+
+ queue.addTrack(song.tracks[0]);
+ queue.play();
```

> Everything related to music player is moved to `Queue`.

## How do I reply to the event like v4?

Since we got rid of `message` parameter in every method of the Discord Player, you no longer have access to the `message` object in events.
Instead, we have added `<Queue>.metadata` prop as an alternative. This `metadata` can be anything, declared while creating queue:

```js
const queue = player.createQueue(message.guild, {
    metadata: message
});
```

The metadata `message` will always be available in every event emitted for that specific `Queue`. You can access it via `queue.metadata`:

```js
player.on("trackStart", (queue, track) => {
    const channel = queue.metadata.channel; // queue.metadata is your "message" object
    channel.send(`üé∂ | Started playing **${track.title}**`);
});
```

## How do I stop the player

You have to use `<Queue>.destroy()` to destroy the queue. It will also stop the player.

```js
const queue = player.getQueue(message.guild.id);
if (queue) queue.destroy();
```

## Updating filters

Discord Player v5.x has new option `bufferingTimeout` in queue init options which allows you to set stream buffering timeout before playing.
This might be useful if you want to have smooth filters update. By default, it is set to 3 seconds.

extractor.content:
# Discord Player Extractor API
The Extractor API allows you to build your own stream extractor for **Discord Player**.

# Example Extractor
Your extractor should have 2 methods (required):
 - `validate(query): boolean`

   This method is called by Discord Player while validating the query provided via `Player.search()`. (Note that only `string` queries are passed to your extractor)

 - `getInfo(query): object`

   This method is used by Discord Player to create `Track` object. You can return your data here that gets passed to `Track`.
   Your info must be similar to this:

    ```js
    {
        // the title
        title: "Extracted by custom extractor",
        // the duration in ms
        duration: 20000,
        // the thumbnail
        thumbnail: "some thumbnail link",
        // engine, can be Readable streams or link to raw stream that gets played
        engine: "someStreamLink",
        // number of views
        views: 0,
        // author of this stream
        author: "Some Artist",
        // description
        description: "",
        // link of this stream
        url: "Some Link"
    }
    ```

 - `version: string`

   This should be the version of your extractor. It is not really important and is set to `0.0.0` by default.

# Loading Extractors
Discord Player Extractors can be loaded using `Player.use(ExtractorName, Extractor)` method.

## Register Extractor

```js
const myExtractor = {
  version: "1.0.0",
  important: false,
  validate: (query) => true,
  getInfo: async (query) => {
    return {
        title: "Extracted by custom extractor",
        duration: 20000,
        thumbnail: "some thumbnail link",
        engine: "someStreamLink",
        views: 0,
        author: "Some Artist",
        description: "",
        url: "Some Link"
    };
  }
};

player.use("GiveItSomeName", myExtractor);
```

## Remove Extractor

```js
player.unuse("GiveItSomeName");
```

# Readymade Extractors
## **[@discord-player/extractor](https://github.com/Snowflake107/discord-player-extractors)**
This extractor enables optional sources such as `Discord Attachments`, `Vimeo`, `Facebook` and `Reverbnation`. It also enables the `Lyrics` feature!

## **[@discord-player/downloader](https://github.com/DevSnowflake/discord-player-downloader)**
This extractor is based on **[YouTube DL](https://youtube-dl.org)**. This extractor enables `700+ websites` support. However, this extractor can get buggy and is not updated frequently. So, it is suggested to make your own extractor if you want to use it!

```js
const downloader = require("@discord-player/downloader").Downloader;

player.use("YOUTUBE_DL", downloader);
```

> Discord Player auto-detects and uses `@discord-player/extractor` if it is installed!

create_stream.content:
# Create Stream

This is a checkpoint where discord-player calls `createStream` before downloading stream.

### Custom stream Engine

Discord Player by default uses **[node-ytdl-core](https://github.com/fent/node-ytdl-core)** for youtube and some other extractors for other sources.
If you need to modify this behavior without touching extractors, you need to use `createStream` functionality of discord player.
Here's an example on how you can use **[play-dl](https://npmjs.com/package/play-dl)** to download youtube streams instead of using ytdl-core.

```js
const playdl = require("play-dl");

// other code
const queue = player.createQueue(..., {
    ...,
    async onBeforeCreateStream(track, source, _queue) {
        // only trap youtube source
        if (source === "youtube") {
            // track here would be youtube track
            return (await playdl.stream(track.url, { discordPlayerCompatibility : true })).stream;
            // we must return readable stream or void (returning void means telling discord-player to look for default extractor)
        }
    }
});
```

`<Queue>.onBeforeCreateStream` is called before actually downloading the stream. It is a different concept from extractors, where you are **just** downloading
streams. `source` here will be a video source. Streams from `onBeforeCreateStream` are then piped to `FFmpeg` and finally sent to Discord voice servers.

# FAQ
## How can I remove this?

> If you already made this change and want to switch to default mode in runtime,
> you can set `queue.onBeforeCreateStream` to `null` which will make `discord-player` use default config.

## Which stream format should I return?

> It's not necessary to return opus format or whatever, since every streams have to be converted to s16le, due to inline volume.

## Can I use ytdl-core-discord?

> Yes, you can.

## Can I use this for other sources, like soundcloud?

> Absolutely.

## This is not working properly

> `onBeforeCreateStream` may not work properly if you have `spotifyBridge` enabled (enabled by default).

